import React from 'react';
import Pregunta from './components/Pregunta';

class App extends React.Component {
	state = {};

	render() {
		return (
			<div className="container">
				<header>
					<h1>Gasto Semanal</h1>
				</header>

				<Pregunta />
			</div>
		);
	}
}

export default App;
